            panel.updateDrawCallSegment(geometryIndex, indexStart, indexCount);
            let material = panel["_uiRenderer"]["materials"][geometryIndex];
            material.setTextures(textureList);
            textureMap.clear();
            textureList.length = 0;
            geometryIndex++;
            indexStart += indexCount;
            indexCount = 0;
            texIndex = 0;
