    class PoolNode {
      _use;
      _unUse;
      constructor() {
        this._use = [];
        this._unUse = [];
      }
      pushBack(node) {
        let index = this._use.indexOf(node);
        if (index != -1) {
          this._use.splice(index, 1);
          this._unUse.push(node);
        }
      }
      getUseList() {
        return this._use;
      }
      getOne(instance, param) {
        let node;
        if (this._unUse.length > 0) {
          node = this._unUse[0];
          this._unUse.splice(0, 1);
          this._use.push(node);
          return node;
        } else {
          node = new instance(param);
          this._use.push(node);
        }
        return node;
      }
      hasFree() {
        return this._unUse.length > 0;
      }
    }

